import React from 'react';
import './Footer.css';



const Footer = () => {
    return (
        <div id='footer'>
            <div className='footer'>
                <div className='container'>

                    <ul>
                        <li className='nav-item'> <a href='/'>Home</a> </li>

                        <li className='nav-item'> <a href='#about'>About</a> </li>

                        <li className='nav-item'> <a href='#tertimonials'>Testimonials</a> </li>

                        <li className='nav-item'> <a href='#contact'>Contact</a> </li>
                    </ul>

                    <div className='bottom'>
                        <span className='line'></span>
                        <span className='icon'><i class="fab fa-facebook"></i></span>
                        <span className='icon'><i class="fab fa-instagram"></i></span>
                        <span className='icon'><i class="fab fa-instagram-square"></i>></span>
                        <p>Tim Mango, Inc. All rights reserved</p>
                    </div>

                </div>
            </div>
        </div >
    )
};

export default Footer;
